// src/firebase.config.js

// Your Firebase configuration - replace with your actual Firebase project settings
export const firebaseConfig = {
  apiKey: "your-api-key-here",
  authDomain: "your-project.firebaseapp.com",
  projectId: "your-project-id",
  storageBucket: "your-project.appspot.com",
  messagingSenderId: "123456789",
  appId: "your-app-id"
};

// App ID for your application
export const appId = "documanage-app";

// Initial auth token (set to null for anonymous auth)
export const initialAuthToken = null;
